import React, { Component } from 'react';
import axios from 'axios';
import Button from '@mui/material/Button';

class User extends Component {
    state = {
        users: [
            {
                address
                    :
                    "Bo Ly",
                birthday
                    :
                    "12/12/2002",
                createTime
                    :
                    null,
                email
                    :
                    "minhnghia12122002@gmail.com",
                id
                    :
                    1,
                isActive
                    :
                    false,
                password
                    :
                    "abc123",
                phoneNumber
                    :
                    "0975815593",
                roleId:0,
                updateTime: null
            }
        ]
    }

    async componentDidMount() {
        let res = await axios.get('http://localhost:8080/admin/user/allUser');
        console.log(res.data)
        this.setState({
            users: res.data
        })
    }

    render() {
        let listUser = this.state.users
        return (
            <>
                <div>
                    {
                        listUser.map((item, index) => {
                            return (
                                <div>
                                    {index}
                                </div>
                            )
                        })
                    }
                </div>
            </>
        );
    }
}

export default User;
